#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAXN 26

int dfs(char *s, int *wins, int *visited, int n) {
    if (visited[n]) return wins[n];
    if (s[n] == '[') {
        int a = dfs(s, wins, visited, n + 1);
        int b = dfs(s, wins, visited, n + 3);
        if (a > b) return wins[n] = wins[n + 1] + 1;
        else return wins[n] = wins[n + 3] + 1;
    } else {
        visited[n] = 1;
        return wins[n];
    }
}

int main() {
    char s[1000];
    int wins[MAXN];
    int visited[MAXN];
    int n;

    scanf("%s", s);
    n = strlen(s);
    for (int i = 0; i < n; i++) {
        if (s[i] == '[') {
            i++;
            while (s[i] != ']') i++;
        }
    }
    n = 0;
    while (s[n] != '\0') {
        wins[s[n] - 'a'] = 0;
        visited[s[n] - 'a'] = 0;
        n++;
    }
    n = 0;
    while (s[n] != '\0') {
        int a, b;
        scanf("%c %d", &a, &b);
        wins[a - 'a'] = b;
        n++;
    }
    for (int i = 0; i < n; i++) {
        if (dfs(s, wins, visited, i) != wins[i]) {
            printf("No\n");
            return 0;
        }
    }
    printf("Yes\n");
    return 0;
}
